BEGIN
-- !!! NOTE TEST DATA ONLY !!!
-- Set the number of Events and Weeks required, and optionally to add attendances for existing members
-- !!! THIS WILL REMOVE EXISTING RECORDS FROM [dbo].[Attendance], [dbo].[EventGuest], [dbo].[CalendarEvent] !!!

DECLARE 
-- number of calendar events required
@results int = 10000,
 -- number of events per week
@eventsperweek int = 160,
-- make it a Monday
@stardate datetime = '29-May-23',
-- set to 1 to add members and attendance
@addattendance int = 1;

SELECT @results / @eventsperweek NumberOfWeeks

CREATE TABLE #SCHOOLS
(
    [URN] BIGINT NULL,
    [Postcode] NVARCHAR(10) NULL, 
    [EstablishmentName]  NVARCHAR(100) NULL, 
    [Location] NVARCHAR(200) NULL, 
    [TypeOfEstablishment] NVARCHAR(200) NULL, 
);

CREATE TABLE #POSTCODEREGION (
    PostCodePrefix NVARCHAR(2) NOT NULL,
    Region  NVARCHAR(50)  NOT NULL,
    RegionId [int] NULL
);

CREATE TABLE #MAPPOSTCODES (
    [Postcode] NVARCHAR(10) NULL, 
    [Description] NVARCHAR(100) NULL, 
    [GridReference] NVARCHAR(20) NULL,     
    [X_easting] NVARCHAR(20) NULL,     
    [Y_northing] NVARCHAR(20) NULL,     
    [Latitude] NVARCHAR(20) NULL,
    [Longitude] NVARCHAR(20) NULL,
);

CREATE TABLE #CONTACTS
(   [Id] Int NULL,
    [Name] NVARCHAR(200) NULL,
    [Email] NVARCHAR(200) NULL,
);

CREATE TABLE #GUESTS
(   [Id] Int NULL,
    [Name] NVARCHAR(200) NULL,
    [Title] NVARCHAR(200) NULL,
);




SELECT COUNT(*) HowManySchools FROM #SCHOOLS;


    
SELECT COUNT(*) HowManyPostCodeRegions FROM #POSTCODEREGION;    
    




SELECT COUNT(*) HowManyLocations FROM #MAPPOSTCODES;

-- 20 random contacts

SELECT COUNT(*) HowManyContacts FROM #CONTACTS;


SELECT COUNT(*) HowManyGuests FROM #GUESTS;


SELECT COUNT(*) SchoolsandPostcodes FROM (SELECT LEFT(PostCode,(PATINDEX('%[0-9]%',ISNULL(PostCode,'ZZ'))-1)) outcode, * FROM #SCHOOLS) sc1 
JOIN #MAPPOSTCODES mp1 on mp1.postcode = sc1.postcode;

SELECT COUNT(*) SchoolsPostcodesandRegions FROM (SELECT LEFT(PostCode,(PATINDEX('%[0-9]%',ISNULL(PostCode,'ZZ'))-1)) outcode, * FROM #SCHOOLS WHERE Postcode IS NOT NULL) sc1 
JOIN #MAPPOSTCODES mp1 on mp1.postcode = sc1.postcode 
JOIN #POSTCODEREGION por on por.PostCodePrefix = sc1.outcode
JOIN [dbo].[Region] reg on reg.id = por.Regionid;

-- tidyup old events

DELETE FROM [dbo].[Attendance] WHERE 1=1;
DELETE FROM [dbo].[EventGuest] WHERE 1=1;
DELETE FROM [dbo].[CalendarEvent] WHERE 1=1;

-- Generate randomised test data

DECLARE @row int, @rand FLOAT, @line Int, @urns int, @date datetime, @hour int, 
@dayofweek int, @week int, @format int, @eventtype varchar(10), 
@eventlink varchar(200) = 'www.test.com/link?pwd=abcdefg',
@contact int, @contacts int,
@contactname varchar(200), @contactemail varchar(200),
@calendarname varchar(200), @calendarid int, @calendars int,
@guests int, @guestid int, @guestname varchar(200), @guesttitle varchar(200), @guestcount int,
@des1 int, @des2 int,
@members int, @attendeecount int, @memberid int,
@enddate datetime;

-- list of viable URNs
SET @urns = (SELECT COUNT(*) SchoolsPostcodesandRegions FROM (SELECT LEFT(PostCode,(PATINDEX('%[0-9]%',ISNULL(PostCode,'ZZ'))-1)) outcode, * FROM #SCHOOLS WHERE Postcode IS NOT NULL) sc1 
JOIN #MAPPOSTCODES mp1 on mp1.postcode = sc1.postcode 
JOIN #POSTCODEREGION por on por.PostCodePrefix = sc1.outcode
JOIN [dbo].[Region] reg on reg.id = por.Regionid);

-- generate @results rows
SET @row = 1;

WHILE @row <= @results
BEGIN
    SELECT @rand = ab1.RND FROM (
    SELECT  CAST('0.'+REPLACE(TRANSLATE(NEWID(), 'ABCDEF-', '#######'),'#','') AS FLOAT) AS RND
    ) ab1

    SET @line = @rand*(@urns-1)+1;
    SET @dayofweek = @row % 5;
    SET @week = @row / @eventsperweek;
    SET @hour = 9 + (@line % 6);  -- start between 09:00 and 15:00
    SET @date = DATEADD(hour,@hour,DATEADD(day,@dayofweek,DATEADD(week,@week,@stardate)));
    SET @format = @line % 3;  -- one of three formats "Online"|"Hybrid"|"InPerson"
    SET @eventtype = CASE @format WHEN 0 THEN 'Online' WHEN 1 THEN 'Hybrid' ELSE 'InPerson' END;

    SELECT @contacts = COUNT(*) FROM #CONTACTS;
    SET @contact = (@line % (@contacts));  -- contact 0 -19
    SELECT @contactname = [name], @contactemail = [Email] FROM #CONTACTS WHERE [Id] = @contact;

    SELECT @calendars = COUNT(*) FROM [dbo].[Calendar];
    SET @calendarid = 1 + (@line % (@calendars));  -- calendar 1 to 7
    SELECT @calendarname = [CalendarName] FROM [dbo].[Calendar] WHERE [Id] = @calendarid;
/*
Id    CalendarName
1    Employer engagement event
2    National/Regional meeting
3    School and College event
4    Careers event
5    Social/Networking activity
6    Training event
7    Other
*/
    SET @des1 = @row % 4;
    SET @des2 = @line % 4;

    SELECT  
    @calendarid [CalendarId], 
    @eventtype [EventFormat],
    @date [StartDate], 
    DATEADD(hour,2,@date) [EndDate], 
    'A' + CASE @format WHEN 0 THEN 'n online' WHEN 1 THEN ' hybrid' ELSE 'n in person' END + ' event for ' +  @calendarname + ' in ' + [Area] + ' region' [Description], 
    'This event is for a'
    + CASE @des1 WHEN 0 THEN ' wonderful' WHEN 1 THEN 'n exciting' WHEN 2 THEN 'n interesting' WHEN 3 THEN ' stimulating' ELSE ' regular' END + ' ' 
    + CASE @des2 WHEN 0 THEN 'meeting' WHEN 1 THEN 'discussion' WHEN 2 THEN 'session' WHEN 3 THEN 'convention' ELSE 'assembly' END + ' in '
    + [Area]
    + ' to meet with Apprenticeship Ambassador members '
    + CASE @format WHEN 0 THEN 'online' WHEN 1 THEN 'in person or online' ELSE 'in person' END
    [Summary], 
    [RegionId],
    CASE @format WHEN 0 THEN null ELSE [EstablishmentName] + ',' + [Location] END [Location], 
    CASE @format WHEN 0 THEN null ELSE [Postcode] END [Postcode], 
    CASE @format WHEN 0 THEN null ELSE [Latitude] END [Latitude],
    CASE @format WHEN 0 THEN null ELSE [Longitude] END [Longitude],
    CASE @calendarid WHEN 3 THEN [URN] ELSE null END [URN],
    CASE @format WHEN 2 THEN null ELSE @eventlink+'&id='+CONVERT(varchar,@line) END [EventLink], 
    @contactname [ContactName], 
    @contactemail [ContactEmail]
    FROM 
    (
    SELECT CONVERT(int,@line) hit, row_number() over (order by urn) rownumber, sc1.* , mp1.Latitude, mp1.Longitude, por.RegionId, reg.Area
    FROM (SELECT LEFT(PostCode,(PATINDEX('%[0-9]%',ISNULL(PostCode,'ZZ'))-1)) outcode, * FROM #SCHOOLS WHERE Postcode IS NOT NULL) sc1
    JOIN #MAPPOSTCODES mp1 on mp1.postcode = sc1.postcode
    JOIN #POSTCODEREGION por on por.PostCodePrefix = sc1.outcode
    JOIN [dbo].[Region] reg on reg.id = por.Regionid
    ) ab1 
    WHERE rownumber = hit; 

    SET @row = @row + 1;
END 

SELECT COUNT (*) HowManyEvents FROM [dbo].[CalendarEvent]

-- for each new calendar event will add guests
DECLARE @rowid UNIQUEIDENTIFIER;
DECLARE #cursor CURSOR FOR
SELECT [Id], (Convert(int,LEFT(CONVERT(varchar,startdate,8),2))+CalendarId) % 4 [guestcount] FROM [dbo].[CalendarEvent];

SELECT @guests = COUNT(*) FROM #GUESTS;

OPEN #cursor
FETCH NEXT FROM #cursor INTO @rowid, @guestcount;

-- random start point for guests    
SET @row = @guests +  @guestcount;

WHILE @@FETCH_STATUS = 0
BEGIN
    -- random number of guests 0 - 3
    WHILE @guestcount > 0 
    BEGIN
        SET @guestid = (@row % (@guests));  -- guests 0 to 29
        --PRINT 'guestid ' + CONVERT(varchar,@guestid);
        MERGE INTO [dbo].[EventGuest] evg
        USING 
        (SELECT @rowid [CalendarEventId], [Name] [GuestName], [Title] [GuestJobTitle] FROM #GUESTS WHERE [Id] = @guestid) upd
        ON (upd.[CalendarEventId] = evg.[CalendarEventId] AND upd.[GuestName] = evg.[GuestName])
        WHEN NOT MATCHED THEN
        INSERT ([CalendarEventId],[GuestName],[GuestJobTitle])
        VALUES (upd.[CalendarEventId],upd.[GuestName],upd.[GuestJobTitle]);

        SET @guestcount = @guestcount - 1;
        SET @row = @row + 1;
    END
    FETCH NEXT FROM #cursor INTO @rowid, @guestcount;
END 

CLOSE #cursor  
DEALLOCATE #cursor 

-- add attendance ?
-- check how many live members
SELECT @members = COUNT(*) FROM [dbo].[Member] WHERE [Status] = 'live';

IF @addattendance = 1 AND @members > 0
BEGIN
-- use current members to add attendances, from 0 to 5
    DECLARE #cursor2 CURSOR FOR
    SELECT [Id], (([Regionid] * Convert(int,LEFT(CONVERT(varchar,startdate,8),2))+CalendarId)) % 5 [attendeecount] FROM [dbo].[CalendarEvent];

    OPEN #cursor2
    FETCH NEXT FROM #cursor2 INTO @rowid, @attendeecount;

    WHILE @@FETCH_STATUS = 0
    BEGIN
        -- random number of attendees 0 - 5
        WHILE @attendeecount > 0 
        BEGIN
            -- generate random number to acess the member
            SELECT @rand = ab1.RND FROM (
            SELECT  CAST('0.'+REPLACE(TRANSLATE(NEWID(), 'ABCDEF-', '#######'),'#','') AS FLOAT) AS RND
            ) ab1

            SET @line = @rand*(@members-1)+1;

            MERGE INTO [dbo].[Attendance] att
            USING 
            (SELECT @rowid [CalendarEventId], [MemberId] FROM (SELECT ROW_NUMBER() OVER (ORDER BY [Id]) line, [Id] [MemberId] FROM [dbo].[Member] WHERE [Status] = 'live' ) ab2 WHERE [line] = @line) upd
            ON (upd.[CalendarEventId] = att.[CalendarEventId] AND upd.[MemberId] = att.[MemberId])
            WHEN NOT MATCHED THEN
            INSERT ([CalendarEventId],[MemberId])
            VALUES (upd.[CalendarEventId],upd.[MemberId]);
             
            SET @attendeecount = @attendeecount - 1;
        END
        FETCH NEXT FROM #cursor2 INTO @rowid, @attendeecount;
    END 

    CLOSE #cursor2;  
    DEALLOCATE #cursor2; 

END

-- Tidyup
DROP TABLE #SCHOOLS;
DROP TABLE #POSTCODEREGION;
DROP TABLE #MAPPOSTCODES;
DROP TABLE #CONTACTS;
DROP TABLE #GUESTS;



END

